function add(){
    var args = arguments,//
        lens = args.length,//
        d = 0,//0
        sum = 0;//sum
    //
    for(var key in args){//
        //
        var str = ""+args[key];
        if(str.indexOf(".")!=-1){//
            //
            var temp = str.split(".")[1].length;
            //d
            d = d < temp ? temp : d;
        }
    }
    //
    var m = Math.pow(10,d);
    //
    for(var key1 in args){
        sum += args[key1]*m;
    }
    //
    return sum/m;
}

function deci(num, v) {
    /*
        
        num
        v
    */
    var vv = Math.pow(10, v);
    return Math.round(num * vv) / vv;
}

